import React from 'react';
import Header from "./Header";
import {
   Route
} from "react-router-dom";
import PrivacyPolicy from "./PrivacyPolicy";

function App() {
  return (
    <div className="App">
      <Header />
      <Route path="/privacypolicy" component={PrivacyPolicy} />
    </div>
  );
}

export default App;
